export const Options = ({ options, onLeaveFeedback }) => {
  return (
    <>
      <ul className="">
        {options.map(option => (
          <li className="" key={shortid.generate()}>
            <button
              type="button"
              value={option}
              className="btn"
              onClick={onLeaveFeedback}
            >
              {option}
            </button>
          </li>
        ))}
      </ul>
    </>
  );
};
